import React from "react";
import "./App.css";
import Nav from "../nav";
import Footer from "../footer";
import { HomePage, AboutUsPage, RecipePage, ContactUsPage } from "../pages";
import ContentContainer from "../content-container";
import { BrowserRouter as Router, Route } from "react-router-dom";

export default function App() {
  return (
    <div className="App">
      <Nav />
      <ContentContainer>
        <Router>
          <HomePage />
          <AboutUsPage />
          <RecipePage />
          <ContactUsPage />
        </Router>
      </ContentContainer>
      <Footer />
    </div>
  );
}
